import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import About from "./pages/About";
import Collections from "./pages/Collection";
import BridalCollection from "./pages/BridalCollection";
import EverydayCollection from "./pages/EverydayCollection";
import LuxuryCollection from "./pages/LuxuryCollection";
import BridalNecklace from "./pages/BridalNecklace";
import BridalEarring from "./pages/BridalEarring";
import BridalRing from "./pages/BridalRing";
import BridalBracelet from "./pages/BridalBracelet";
import EverydayNecklace from "./pages/EverydayNecklace";
import EverydayEarring from "./pages/EverydayEarring";
import EverydayRing from "./pages/EverydayRing";
import EverydayBracelet from "./pages/EverydayBracelet";
import LuxuryNecklace from "./pages/LuxuryNecklace";
import LuxuryEarring from "./pages/LuxuryEarring";
import LuxuryRing from "./pages/LuxuryRing";
import LuxuryBracelet from "./pages/LuxuryBracelet";




function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/collections" element={<Collections />} />
        <Route path="/collections/bridal" element={<BridalCollection />} />
        <Route path="/collections/everyday" element={<EverydayCollection />} />
        <Route path="/collections/luxury" element={<LuxuryCollection />} />
        <Route path="/collections/bridal/necklace" element={<BridalNecklace />} />
        <Route path="/collections/bridal/earring" element={<BridalEarring />} />
        <Route path="/collections/bridal/ring" element={<BridalRing />} />
        <Route path="/collections/bridal/bracelet" element={<BridalBracelet />} />
        <Route path="/collections/everyday/necklace" element={<EverydayNecklace />} />
        <Route path="/collections/everyday/earring" element={<EverydayEarring />} />
        <Route path="/collections/everyday/ring" element={<EverydayRing />} />
        <Route path="/collections/everyday/bracelet" element={<EverydayBracelet />} />
        <Route path="/collections/everyday/bracelet" element={<EverydayBracelet />} />
        <Route path="/collections/everyday/bracelet" element={<EverydayBracelet />} />
                       <Route path="/collections/everyday/bracelet" element={<EverydayBracelet />} />
                            <Route path="/collections/everyday/bracelet" element={<EverydayBracelet />} />

      </Routes>
    </Router>
  );
}

export default App;
